import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Artists from './pages/Artists';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/artists" component={Artists} />
      </Switch>
    </Router>
  );
};

export default App;
